package cn.restaurant.entity;

public class Waiter {
private String waiterNumber;
private String waiterName;
private String waiterPass;
private String waiterSex;
private String waiterPhone;
private float waiterMoney;
public float getWaiterMoney() {
	return waiterMoney;
}
public void setWaiterMoney(float waiterMoney) {
	this.waiterMoney = waiterMoney;
}
public Waiter() {
	// TODO Auto-generated constructor stub
}
public String getWaiterNumber() {
	return waiterNumber;
}
public void setWaiterNumber(String waiterNumber) {
	this.waiterNumber = waiterNumber;
}
public String getWaiterName() {
	return waiterName;
}
public void setWaiterName(String waiterName) {
	this.waiterName = waiterName;
}
public String getWaiterPass() {
	return waiterPass;
}
public void setWaiterPass(String waiterPass) {
	this.waiterPass = waiterPass;
}
public String getWaiterSex() {
	return waiterSex;
}
public void setWaiterSex(String waiterSex) {
	this.waiterSex = waiterSex;
}
public String getWaiterPhone() {
	return waiterPhone;
}
public void setWaiterPhone(String waiterPhone) {
	this.waiterPhone = waiterPhone;
}

}
